INSERT INTO `v1_d56e757095c5b0af1b580702dc66494341611f0b3531c50bc9b7a6e5fed75223` VALUES (1, 1, 3, "スタンダードコレクション", "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_d56e757095c5b0af1b580702dc66494341611f0b3531c50bc9b7a6e5fed75223` VALUES (2, 1, 10, "プレミアムコレクション", "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！");
INSERT INTO `v1_d56e757095c5b0af1b580702dc66494341611f0b3531c50bc9b7a6e5fed75223` VALUES (3, 1, 3, "フェスコレクション", "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！");
